import React, { Component } from 'react';

import './styles/foundation.min.css';
import './styles/custom.css';
import Routes from './routes';



class App extends Component {

 

  render() {
    return (
      

     

        <div className="off-canvas-content" data-off-canvas-content>
         
          <Routes/>
          <hr/>

      
    </div>
    );
  }
}

export default App;
